import React, { useState, useEffect, useCallback } from 'react';
import api from '../services/api';
import { Typography, Button, List, ListItem, ListItemText, Paper, TextField, Dialog, DialogActions, DialogContent, DialogTitle, IconButton, Grid, Box } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { format } from 'date-fns';

const moodIcons = [
  { icon: <SentimentVeryDissatisfiedIcon />, label: 'Very Bad' },
  { icon: <SentimentDissatisfiedIcon />, label: 'Bad' },
  { icon: <SentimentSatisfiedIcon />, label: 'Okay' },
  { icon: <SentimentSatisfiedAltIcon />, label: 'Good' },
  { icon: <SentimentVerySatisfiedIcon />, label: 'Very Good' },
];

const MoodTracker = ({ onMoodSelect }) => {
  return (
    <Paper elevation={3} sx={{ p: 2, mb: 2 }}>
      <Typography variant="h6" gutterBottom>How are you feeling today?</Typography>
      <Grid container spacing={2} justifyContent="center">
        {moodIcons.map((mood, index) => (
          <Grid item key={index}>
            <IconButton onClick={() => onMoodSelect(index)} size="large" color="primary">
              {mood.icon}
            </IconButton>
            <Typography variant="caption">{mood.label}</Typography>
          </Grid>
        ))}
      </Grid>
    </Paper>
  );
};

const VitalsScreen = () => {
  const [vitals, setVitals] = useState([]);
  const [open, setOpen] = useState(false);
  const [newVital, setNewVital] = useState({ type: '', value: '' });
  const [chartData, setChartData] = useState([]);
  const [error, setError] = useState('');

  const prepareChartData = useCallback(() => {
    const data = {};
    vitals.forEach(vital => {
      const date = format(new Date(vital.date), 'MM/dd/yyyy');
      if (!data[date]) {
        data[date] = { date };
      }
      data[date][vital.type] = parseFloat(vital.value);
    });
    setChartData(Object.values(data).sort((a, b) => new Date(a.date) - new Date(b.date)));
  }, [vitals]);

  useEffect(() => {
    fetchVitals();
  }, []);

  useEffect(() => {
    prepareChartData();
  }, [vitals, prepareChartData]);

  const fetchVitals = async () => {
    try {
      const response = await api.getVitals();
      setVitals(response.data);
    } catch (error) {
      console.error('Error fetching vitals:', error);
    }
  };

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    setNewVital({ ...newVital, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    if (!newVital.type || !newVital.value) {
      setError('Please fill in both fields');
      return;
    }
    if (isNaN(parseFloat(newVital.value))) {
      setError('Value must be a number');
      return;
    }
    try {
      console.log('Submitting vital:', newVital);
      const response = await api.addVital(newVital);
      console.log('Vital added:', response.data);
      setOpen(false);
      setError('');
      fetchVitals();
    } catch (error) {
      console.error('Error adding vital:', error.response ? error.response.data : error.message);
      setError('Failed to add vital. Please try again.');
    }
  };

  const handleDelete = async (id) => {
    try {
      await api.deleteVital(id);
      fetchVitals();
    } catch (error) {
      console.error('Error deleting vital:', error);
    }
  };

  const handleMoodSelect = async (moodIndex) => {
    try {
      const newVital = { type: 'Mood', value: moodIndex.toString() };
      await api.addVital(newVital);
      fetchVitals();
    } catch (error) {
      console.error('Error adding mood:', error);
    }
  };

  const vitalTypes = [...new Set(vitals.map(vital => vital.type))];
  const colors = ['#8884d8', '#82ca9d', '#ffc658', '#ff7300', '#0088FE'];

  return (
    <Box sx={{ flexGrow: 1, p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Vitals Tracking
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <MoodTracker onMoodSelect={handleMoodSelect} />
        </Grid>
        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 3, height: '400px' }}>
            <Typography variant="h6" gutterBottom>Vitals Chart</Typography>
            {chartData.length > 0 ? (
              <ResponsiveContainer width="100%" height="100%">
                <LineChart data={chartData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="date" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  {vitalTypes.map((type, index) => (
                    <Line 
                      key={type}
                      type="monotone"
                      dataKey={type}
                      stroke={colors[index % colors.length]}
                      activeDot={{ r: 8 }}
                    />
                  ))}
                </LineChart>
              </ResponsiveContainer>
            ) : (
              <Typography>No vitals data available</Typography>
            )}
          </Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 3, height: '300px', overflow: 'auto' }}>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
              <Typography variant="h6">Vitals History</Typography>
              <Button variant="contained" onClick={handleClickOpen} startIcon={<AddIcon />}>
                Add Vital
              </Button>
            </Box>
            {vitals.length > 0 ? (
              <List>
                {vitals.map((vital) => (
                  <ListItem key={vital.id} secondaryAction={
                    <IconButton edge="end" aria-label="delete" onClick={() => handleDelete(vital.id)}>
                      <DeleteIcon />
                    </IconButton>
                  }>
                    <ListItemText
                      primary={`${vital.type}: ${vital.value}`}
                      secondary={new Date(vital.date).toLocaleString()}
                    />
                  </ListItem>
                ))}
              </List>
            ) : (
              <Typography>No vitals recorded yet.</Typography>
            )}
          </Paper>
        </Grid>
      </Grid>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add New Vital</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            name="type"
            label="Vital Type"
            type="text"
            fullWidth
            variant="outlined"
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="value"
            label="Value"
            type="text"
            fullWidth
            variant="outlined"
            onChange={handleChange}
          />
          {error && <Typography color="error">{error}</Typography>}
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained">Add</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default VitalsScreen;
